import React from 'react';
import './coin.css';

const Coin = ({
  name,
  price,
  symbol,
  marketcap,
  volume,
  image,
  priceChange
}) => {
  return (
    <div className='coin-container'>
      <img src={image} />
      <h1>{name}</h1>
      
    </div>
  );
};

export default Coin;
